import { useState } from 'react';

const Homepage = () => {

    const [blogs, setBlogs] = useState([
        {
            title: 'My new website',
            body: 'lorem ipsum....',
            author: 'mario',
            id: 1
        },
        {
            title: 'Welcome to my party!',
            body: 'lorem ipsum....',
            author: 'yoshi',
            id: 2
        },
        {
            title: 'Web dev top tips',
            body: 'lorem ipsum....',
            author: 'mario',
            id: 3
        }
    ]);

    return (
        <div className="home">
            {blogs.map((blog) => (
                <div className="bog-preview">
                    <h2>{blog.title}</h2>
                    <p>Written by {blog.author} !</p>
                </div>
            ))}
        </div>
    );
}

export default Homepage;
